            mass_OAS(1,:) = u0OAS;
            mass_OANF(1,:) = u0OANF;
            mass_OANS(1,:) = u0OANS;
            states(1,:) = u0state;
            
            dMAF(1,:) = k1MAF;
            dMAS(1,:) = k1MAS;
            dMANF(1,:) = k1MANF;
            dMANS(1,:) = k1MANS;
            dOAF(1,:) = k1OAF;
            dOAS(1,:) = k1OAS;
            dOANF(1,:) = k1OANF;
            dOANS(1,:) = k1OANS;
            dstate(1,:) = k1state;

            %     SECOND ITERATION
            % ------------------------
            tracking_var = tracking_var + r.step;
            
            e.mu = interpCO2(tracking_var);
            e.nu = interpCH4(tracking_var);
            e.F_O = interpFO(tracking_var);
            e.F_A = interpFA(tracking_var);
            
            u1MAF = e.mass_MAF;
            u1MAS = e.mass_MAS;
            u1MANF = e.mass_MANF;
            u1MANS = e.mass_MANS;
            u1OAF = e.mass_OAF;
            u1OAS = e.mass_OAS;
            u1OANF = e.mass_OANF;
            u1OANS = e.mass_OANS;
            u1state = e.state;
            
            eqtemp(e,e.tau_s);  
            tau_s(2) = e.tau_s;
            
            D = dynamics(e);
            
            k1MAF = r.step.*D{1};
            k1MAS = r.step.*D{2};
            k1MANF = r.step.*D{3};
            k1MANS = r.step.*D{4};
            k1OAF = r.step.*D{5};
            k1OAS = r.step.*D{6};
            k1OANF = r.step.*D{7};
            k1OANS = r.step.*D{8};
            k1state = r.step.*D{9};

            e.mu = interpCO2(tracking_var)+(1./3).*(interpCO2(tracking_var+r.step)-interpCO2(tracking_var));
            e.nu = interpCH4(tracking_var)+(1./3).*(interpCH4(tracking_var+r.step)-interpCH4(tracking_var));
            e.F_O = interpFO(tracking_var)+(1./3).*(interpFO(tracking_var+r.step)-interpFO(tracking_var));
            e.F_A = interpFA(tracking_var)+(1./3).*(interpFA(tracking_var+r.step)-interpFA(tracking_var));
            
            e.mass_MAF = u1MAF+(1./3).*k1MAF;
            e.mass_MAS = u1MAS+(1./3).*k1MAS;
            e.mass_MANF = u1MANF+(1./3).*k1MANF;
            e.mass_MANS = u1MANS+(1./3).*k1MANS;
            e.mass_OAF = u1OAF+(1./3).*k1OAF;
            e.mass_OAS = u1OAS+(1./3).*k1OAS;
            e.mass_OANF = u1OANF+(1./3).*k1OANF;
            e.mass_OANS = u1OANS+(1./3).*k1OANS;
            e.state = u1state+(1./3).*k1state;
            
            eqtemp(e,e.tau_s);
            
            D = dynamics(e);
            
            k2MAF = r.step.*D{1};
            k2MAS = r.step.*D{2};
            k2MANF = r.step.*D{3};
            k2MANS = r.step.*D{4};
            k2OAF = r.step.*D{5};
            k2OAS = r.step.*D{6};
            k2OANF = r.step.*D{7};
            k2OANS = r.step.*D{8};
            k2state = r.step.*D{9};  

            e.mu = interpCO2(tracking_var)+(2./3).*(interpCO2(tracking_var+r.step)-interpCO2(tracking_var));
            e.nu = interpCH4(tracking_var)+(2./3).*(interpCH4(tracking_var+r.step)-interpCH4(tracking_var));
            e.F_O = interpFO(tracking_var)+(2./3).*(interpFO(tracking_var+r.step)-interpFO(tracking_var));
            e.F_A = interpFA(tracking_var)+(2./3).*(interpFA(tracking_var+r.step)-interpFA(tracking_var));
            
            e.mass_MAF = u1MAF+(2./3).*k2MAF;
            e.mass_MAS = u1MAS+(2./3).*k2MAS;
            e.mass_MANF = u1MANF+(2./3).*k2MANF;
            e.mass_MANS = u1MANS+(2./3).*k2MANS;
            e.mass_OAF = u1OAF+(2./3).*k2OAF;
            e.mass_OAS = u1OAS+(2./3).*k2OAS;
            e.mass_OANF = u1OANF+(2./3).*k2OANF;
            e.mass_OANS = u1OANS+(2./3).*k2OANS;
            e.state = u1state+(2./3).*k2state;
            
            eqtemp(e,e.tau_s); 
            
            D = dynamics(e);
            
            k3MAF = r.step.*D{1};
            k3MAS = r.step.*D{2};
            k3MANF = r.step.*D{3};
            k3MANS = r.step.*D{4};
            k3OAF = r.step.*D{5};
            k3OAS = r.step.*D{6};
            k3OANF = r.step.*D{7};
            k3OANS = r.step.*D{8};
            k3state = r.step.*D{9};

            %combine 
            e.mass_MAF = u1MAF + (1./4).*k1MAF + (3./4).*k3MAF;
            e.mass_MAS = u1MAS + (1./4).*k1MAS + (3./4).*k3MAS;
            e.mass_MANF = u1MANF + (1./4).*k1MANF + (3./4).*k3MANF;
            e.mass_MANS = u1MANS + (1./4).*k1MANS + (3./4).*k3MANS;
            e.mass_OAF = u1OAF + (1./4).*k1OAF + (3./4).*k3OAF;
            e.mass_OAS = u1OAS + (1./4).*k1OAS + (3./4).*k3OAS;
            e.mass_OANF = u1OANF + (1./4).*k1OANF + (3./4).*k3OANF;
            e.mass_OANS = u1OANS + (1./4).*k1OANS + (3./4).*k3OANS;
            e.state = u1state + (1./4).*k1state + (3./4).*k3state;

            
            %get final info for AB3 compatability
            tracking_var = tracking_var + r.step;
            
            e.mu = interpCO2(tracking_var);
            e.nu = interpCH4(tracking_var);
            e.F_O = interpFO(tracking_var);
            e.F_A = interpFA(tracking_var);
            
            u2MAF = e.mass_MAF;
            u2MAS = e.mass_MAS;
            u2MANF = e.mass_MANF;
            u2MANS = e.mass_MANS;
            u2OAF = e.mass_OAF;
            u2OAS = e.mass_OAS;
            u2OANF = e.mass_OANF;
            u2OANS = e.mass_OANS;
            u2state = e.state;
            
            eqtemp(e,e.tau_s);  %update surface temp
            tau_s(3) = e.tau_s;

            %store dynamics and states for AB3
            mass_MAF(2,:) = u1MAF;
            mass_MAS(2,:) = u1MAS;
            mass_MANF(2,:) = u1MANF;
            mass_MANS(2,:) = u1MANS;
            mass_OAF(2,:) = u1OAF;
            mass_OAS(2,:) = u1OAS;
            mass_OANF(2,:) = u1OANF;
            mass_OANS(2,:) = u1OANS;
            states(2,:) = u1state;
            
            dMAF(2,:) = k1MAF;
            dMAS(2,:) = k1MAS;
            dMANF(2,:) = k1MANF;
            dMANS(2,:) = k1MANS;
            dOAF(2,:) = k1OAF;
            dOAS(2,:) = k1OAS;
            dOANF(2,:) = k1OANF;
            dOANS(2,:) = k1OANS;
            dstate(2,:) = k1state;

            mass_MAF(3,:) = u2MAF;
            mass_MAS(3,:) = u2MAS;
            mass_MANF(3,:) = u2MANF;
            mass_MANS(3,:) = u2MANS;
            mass_OAF(3,:) = u2OAF;
            mass_OAS(3,:) = u2OAS;
            mass_OANF(3,:) = u2OANF;
            mass_OANS(3,:) = u2OANS;
            states(3,:) = u2state;
            
            %get final dynamics
            D = dynamics(e);
            
            k1MAF = r.step.*D{1};
            k1MAS = r.step.*D{2};
            k1MANF = r.step.*D{3};
            k1MANS = r.step.*D{4};
            k1OAF = r.step.*D{5};
            k1OAS = r.step.*D{6};
            k1OANF = r.step.*D{7};
            k1OANS = r.step.*D{8};
            k1state = r.step.*D{9};
            
            dMAF(3,:) = k1MAF;
            dMAS(3,:) = k1MAS;
            dMANF(3,:) = k1MANF;
            dMANS(3,:) = k1MANS;
            dOAF(3,:) = k1OAF;
            dOAS(3,:) = k1OAS;
            dOANF(3,:) = k1OANF;
            dOANS(3,:) = k1OANS;
            dstate(3,:) = k1state;

            %from this we obtain first three: surface temps, states, state derivatives

            
            %---------------------------AB3-----------------------------%
            %general function for ab3 step process
            AB3 = @(u_i, f_arr) u_i + (1./12).*(23.*f_arr(3,:) - 16.*f_arr(2,:) + 5.*f_arr(1,:));
            

            tracking_var = tracking_var + r.step;
            while tracking_var<length(carbon) %find index before this 
               
                %compute state using ab3 method
                e.mass_MAF = AB3(mass_MAF(end,:), dMAF(end-2:end, :));
                e.mass_MAS = AB3(mass_MAS(end,:), dMAS(end-2:end, :));
                e.mass_MANF = AB3(mass_MANF(end,:), dMANF(end-2:end, :));
                e.mass_MANS = AB3(mass_MANS(end,:), dMANS(end-2:end, :));
                e.mass_OAF = AB3(mass_OAF(end,:), dOAF(end-2:end, :));
                e.mass_OAS = AB3(mass_OAS(end,:), dOAS(end-2:end, :));
                e.mass_OANF = AB3(mass_OANF(end,:), dOANF(end-2:end, :));
                e.mass_OANS = AB3(mass_OANS(end,:), dOANS(end-2:end, :));
                e.state = AB3(states(end,:), dstate(end-2:end, :));
                
                mass_MAF(end+1,:) = e.mass_MAF;
                mass_MAS(end+1,:) = e.mass_MAS;
                mass_MANF(end+1,:) = e.mass_MANF;
                mass_MANS(end+1,:) = e.mass_MANS;
                mass_OAF(end+1,:) = e.mass_OAF;
                mass_OAS(end+1,:) = e.mass_OAS;
                mass_OANF(end+1,:) = e.mass_OANF;
                mass_OANS(end+1,:) = e.mass_OANS;
                states(end+1,:) = e.state;
                

                %apply forcings 
                e.mu = interpCO2(tracking_var);
                e.nu = interpCH4(tracking_var);
                e.F_O = interpFO(tracking_var);
                e.F_A = interpFA(tracking_var);

                %solve and store tau_s
                eqtemp(e,e.tau_s);
                tau_s(end+1) = e.tau_s;
                %compute dynamics
                D = dynamics(e);
            
                k1MAF = r.step.*D{1};
                k1MAS = r.step.*D{2};
                k1MANF = r.step.*D{3};
                k1MANS = r.step.*D{4};
                k1OAF = r.step.*D{5};
                k1OAS = r.step.*D{6};
                k1OANF = r.step.*D{7};
                k1OANS = r.step.*D{8};
                k1state = r.step.*D{9};
                
                dMAF(end+1,:) = k1MAF;
                dMAS(end+1,:) = k1MAS;
                dMANF(end+1,:) = k1MANF;
                dMANS(end+1,:) = k1MANS;
                dOAF(end+1,:) = k1OAF;
                dOAS(end+1,:) = k1OAS;
                dOANF(end+1,:) = k1OANF;
                dOANS(end+1,:) = k1OANS;
                dstate(end+1,:) = k1state;

                tracking_var = tracking_var + r.step
            end
            info{1} = mass_MAF;
            info{2} = mass_MAS;
            info{3} = mass_MANF;
            info{4} = mass_MANS;
            info{5} = mass_OAF;
            info{6} = mass_OAS;
            info{7} = mass_OANF;
            info{8} = mass_OANS;
            info{9} = states;
            info{10} = dMAF;
            info{11} = dMAS;
            info{12} = dMANF;
            info{13} = dMANS;
            info{14} = dOAF;
            info{15} = dOAS;
            info{16} = dOANF;
            info{17} = dOANS;
            info{18} = dstate;
            info{19} = tau_s;
        end 
        function info = euler(r, carbon, methane)
            clear states mass_MAF mass_MAS mass_MANF mass_MANS mass_OAF mass_OAS mass_OANF mass_OANS;
            clear dstate dMAF dMAS dMANF dMANS dOAF dOAS dOANF dOANS;
            clear tau_s;
            clear e; 
            
            e = copy(r.ebm);
            x0=0.9;
            
            %interpolation stuff for variable step size, small decimal
            %handles NaN exception when x is an int
            interpCO2 = @(x) carbon(floor(x)) + (x - floor(x)).*(carbon(ceil(x)) - carbon(floor(x)))./((ceil(x)+0.000001)-floor(x));
            interpCH4 = @(x) methane(floor(x)) + (x - floor(x)).*(methane(ceil(x)) - methane(floor(x)))./((ceil(x)+0.000001)-floor(x));
            interpFO = @(x) r.FO_arr(floor(x)) + (x - floor(x)).*(r.FO_arr(ceil(x)) - r.FO_arr(floor(x)))./((ceil(x)+0.000001)-floor(x));
            interpFA = @(x) r.FA_arr(floor(x)) + (x - floor(x)).*(r.FA_arr(ceil(x)) - r.FA_arr(floor(x)))./((ceil(x)+0.000001)-floor(x));
            
            tracking_var = 1;
            
            %initial RCP forcings, also prescribe FO and FA
            e.mu = interpCO2(tracking_var);
            e.nu = interpCH4(tracking_var);
            e.F_O = interpFO(tracking_var);
            e.F_A = interpFA(tracking_var);
            
            eqtemp(e,x0);  %internal update to compute tau_s 
            tau_s(1) = e.tau_s;
            
            %store info
            mass_MAF(1,:) = e.mass_MAF;
            mass_MAS(1,:) = e.mass_MAS;
            mass_MANF(1,:) = e.mass_MANF;
            mass_MANS(1,:) = e.mass_MANS;
            mass_OAF(1,:) = e.mass_OAF;
            mass_OAS(1,:) = e.mass_OAS;
            mass_OANF(1,:) = e.mass_OANF;
            mass_OANS(1,:) = e.mass_OANS;
            states = e.state;
            
            D = dynamics(e);
            
            k1MAF = r.step.*D{1};
            k1MAS = r.step.*D{2};
            k1MANF = r.step.*D{3};
            k1MANS = r.step.*D{4};
            k1OAF = r.step.*D{5};
            k1OAS = r.step.*D{6};
            k1OANF = r.step.*D{7};
            k1OANS = r.step.*D{8};
            k1state = r.step.*D{9};
            
            e.mass_MAF = e.mass_MAF + k1MAF;
            e.mass_MAS = e.mass_MAS + k1MAS;
            e.mass_MANF = e.mass_MANF + k1MANF;
            e.mass_MANS = e.mass_MANS + k1MANS;
            e.mass_OAF = e.mass_OAF + k1OAF;
            e.mass_OAS = e.mass_OAS + k1OAS;
            e.mass_OANF = e.mass_OANF + k1OANF;
            e.mass_OANS = e.mass_OANS + k1OANS;
            e.state = e.state + k1state;
            
            %store info 
            mass_MAF(2,:) = e.mass_MAF;
            mass_MAS(2,:) = e.mass_MAS;
            mass_MANF(2,:) = e.mass_MANF;
            mass_MANS(2,:) = e.mass_MANS;
            mass_OAF(2,:) = e.mass_OAF;
            mass_OAS(2,:) = e.mass_OAS;
            mass_OANF(2,:) = e.mass_OANF;
            mass_OANS(2,:) = e.mass_OANS;
            states = e.state;
  
            tracking_var = tracking_var + r.step;
            while tracking_var<length(carbon) %find index before this 

                %apply forcings 
                e.mu = interpCO2(tracking_var);
                e.nu = interpCH4(tracking_var);
                e.F_O = interpFO(tracking_var);
                e.F_A = interpFA(tracking_var);

                %solve and store tau_s
                eqtemp(e,e.tau_s);
                tau_s(end+1) = e.tau_s;
                
                %compute dynamics
                D = dynamics(e);
            
                k1MAF = r.step.*D{1};
                k1MAS = r.step.*D{2};
                k1MANF = r.step.*D{3};
                k1MANS = r.step.*D{4};
                k1OAF = r.step.*D{5};
                k1OAS = r.step.*D{6};
                k1OANF = r.step.*D{7};
                k1OANS = r.step.*D{8};
                k1state = r.step.*D{9};
                
                e.mass_MAF = e.mass_MAF + k1MAF;
                e.mass_MAS = e.mass_MAS + k1MAS;
                e.mass_MANF = e.mass_MANF + k1MANF;
                e.mass_MANS = e.mass_MANS + k1MANS;
                e.mass_OAF = e.mass_OAF + k1OAF;
                e.mass_OAS = e.mass_OAS + k1OAS;
                e.mass_OANF = e.mass_OANF + k1OANF;
                e.mass_OANS = e.mass_OANS + k1OANS;
                e.state = e.state + k1state;
                
                %store info 
                tracking_var
                mass_MAF(end+1,:) = e.mass_MAF;
                mass_MAS(end+1,:) = e.mass_MAS;
                mass_MANF(end+1,:) = e.mass_MANF;
                mass_MANS(end+1,:) = e.mass_MANS;
                mass_OAF(end+1,:) = e.mass_OAF;
                mass_OAS(end+1,:) = e.mass_OAS;
                mass_OANF(end+1,:) = e.mass_OANF;
                mass_OANS(end+1,:) = e.mass_OANS;
                states(end+1,:) = e.state;

                tracking_var = tracking_var + r.step
                
            end
            info{1} = mass_MAF;
            info{2} = mass_MAS;
            info{3} = mass_MANF;
            info{4} = mass_MANS;
            info{5} = mass_OAF;
            info{6} = mass_OAS;
            info{7} = mass_OANF;
            info{8} = mass_OANS;
            info{9} = states;
            info{10} = tau_s;
        end 
        function tau_s = no_permafrost(r, carbon, methane)
            clear tau_s;
            clear e; 

            e = copy(r.ebm);
            x0=0.9;

            %initial RCP forcings 
            e.mu = carbon(1);
            e.nu = methane(1);
            e.F_O = r.FO_arr(1);
            e.F_A = r.FA_arr(1);
            eqtemp(e,x0);  %internal update to compute tau_s 
            tau_s(1) = e.tau_s;

            for i = 1:length(carbon)-1
                e.mu = carbon(1+i);
                e.nu = methane(1+i);
                e.F_O = r.FO_arr(1+i);
                e.F_A = r.FA_arr(1+i);
                %solve and store tau_s
                eqtemp(e,e.tau_s);
                tau_s(end+1) = e.tau_s;
            end
            tauseries = tau_s;
        end 
    end    
end 